              <img src={g2} alt="game1" />
              </Link>
            </div>
            <div>
              <p>Game 3</p>
              <Link to="game3">
              <img src={g3} alt="game1" />
              </Link>
            </div>
            <div>
              <p>Game 4</p>
              <Link to="game4">
              <img src={g4} alt="game1" />
              </Link>
            </div>
        </div>
      </div>
      { leader ?
      <div ref={wrapperRef}>
   <LeaderBoard/>
   </div>:null
      }

    </div>
  );
}
